import React from "react";
import { SidebarData } from "./SidebarData";
import "./Sidebar.css";
function Sidebar() {
  return (
    <div className="Sidebar">
      <ul>
        {SidebarData.map((val, key) => {
          return (
            <li
              key={key}
              className="row"
              onClick={() => {
                window.location.pathname = val.link;
              }}
            >
              {""}
              <div>{val.icons}</div>
              {""}
              <div>{val.title}</div>
            </li>
          );
        })}
      </ul>
    </div>
  );
}
export default Sidebar;
